Item14.Variable:
// 药品通用名
let cadnChinese = $.cadnChinese == null ? "" : $.cadnChinese.trim();
// 药品商品名
let commodityNameChinese = $.commodityNameChinese == null ? "" : $.commodityNameChinese.trim();
// 药品规格
let medicineSpec = $.medicineSpec;
let doseAndUnit = $.doseAndUnit;
// 给药途径(用法)
let dosageRouteDesc = $.dosageRouteDesc;
let freqDesc = $.freqDesc == null ? "" : $.freqDesc;
// 嘱托
let advice = $.advice == null ? "" : $.advice.trim();
// 开立数量(非药品)
let prescribedQtyDN = $.prescribedQtyDN == null ? "" : $.prescribedQtyDN;
// 出院带药
let dischargeOrderScenesCode = $.dischargeOrderScenesCode == null ? "" : $.dischargeOrderScenesCode;
let ord = "";
if ($.parent.orderTypeCode == '256194' || $.parent.orderTypeCode == '256195') {
  ord = cadnChinese;
  if (commodityNameChinese != "") {
    ord = ord + "(" + commodityNameChinese + ")";
  }
} else if ($.parent.orderTypeCode == '256197' || $.parent.orderTypeCode == '256198' || $.parent.orderTypeCode == '384030') {
  ord = $.csName;
} else if ($.parent.orderTypeCode == "256199") {
  ord = $.csName;
} else if ($.parent.orderTypeCode == '384035') {
  ord = $.orderItemContentDisplay;
} else if ($.orderItemContentDisplay.indexOf("重整医嘱") > -1) {
  ord = $.orderItemContentDisplay;
} else {
  ord = $.csName;
}
if (prescribedQtyDN != "" && prescribedQtyDN != 1) {
  ord = ord + "×" + prescribedQtyDN;
}
if (medicineSpec != null) {
  ord = ord + " " + medicineSpec;
}
if (doseAndUnit != null) {
  let measure_width = report.ctx.measureText(ord).width;
  let measure_width2 = report.ctx.measureText(ord + " " + doseAndUnit).width;
  if (measure_width < report.ord_max_width && measure_width2 > report.ord_max_width) {
    ord = ord + "<br/>" + doseAndUnit;
  } else {
    ord = ord + " " + doseAndUnit;
  }
}
if ($.selfAdministrationFlag == "98175") {
  ord = ord + " " + "领药";
} else if (dosageRouteDesc != null) {
  ord = ord + " " + dosageRouteDesc;
}
if (freqDesc != "") {
  ord = ord + " " + freqDesc;
}
if ($.dischargeOrderScenesCode == "399201295") {
  ord = ord + " " + $.dischargeOrderScenesDesc;
}
if (advice != "") {
  ord = ord + " " + advice;
}
return ord;

Item16.Variable:
if($.parent.orderItemList.length > 1){
let begin = report['begin'];
let end = report['end'];
if(($.row === 0) && begin){
return "┐";
}else if(($.row === $.parent.orderItemList.length - 1) && end){
return "┘"; 
}
return "│";
}
